),

{% if dbtvault.is_any_incremental() %}

latest_records AS (
    SELECT {{ dbtvault.prefix(window_cols, 'a', alias_target='target') }}
    FROM (
        SELECT {{ dbtvault.prefix(window_cols, 'current_records', alias_target='target') }},
